import 'package:equatable/equatable.dart';

import 'area.dart';
import 'away_team.dart';
import 'competition.dart';
import 'home_team.dart';
import 'odds.dart';
import 'referee.dart';
import 'score.dart';
import 'season.dart';

class Match extends Equatable {
	final Area? area;
	final Competition? competition;
	final Season? season;
	final int? id;
	final String? utcDate;
	final String? status;
	final int? matchday;
	final String? stage;
	final dynamic group;
	final String? lastUpdated;
	final HomeTeam? homeTeam;
	final AwayTeam? awayTeam;
	final Score? score;
	final Odds? odds;
	final List<Referee>? referees;

	const Match({
		this.area, 
		this.competition, 
		this.season, 
		this.id, 
		this.utcDate, 
		this.status, 
		this.matchday, 
		this.stage, 
		this.group, 
		this.lastUpdated, 
		this.homeTeam, 
		this.awayTeam, 
		this.score, 
		this.odds, 
		this.referees, 
	});

	factory Match.(Map<String, dynamic> json) {
		return Match(
			area: json['area'] == null
						? null
						: Area.(json['area'] as Map<String, dynamic>),
			competition: json['competition'] == null
						? null
						: Competition.(json['competition'] as Map<String, dynamic>),
			season: json['season'] == null
						? null
						: Season.(json['season'] as Map<String, dynamic>),
			id: json['id'] as int?,
			utcDate: json['utcDate'] as String?,
			status: json['status'] as String?,
			matchday: json['matchday'] as int?,
			stage: json['stage'] as String?,
			group: json['group'] as dynamic,
			lastUpdated: json['lastUpdated'] as String?,
			homeTeam: json['homeTeam'] == null
						? null
						: HomeTeam.(json['homeTeam'] as Map<String, dynamic>),
			awayTeam: json['awayTeam'] == null
						? null
						: AwayTeam.(json['awayTeam'] as Map<String, dynamic>),
			score: json['score'] == null
						? null
						: Score.(json['score'] as Map<String, dynamic>),
			odds: json['odds'] == null
						? null
						: Odds.(json['odds'] as Map<String, dynamic>),
			referees: (json['referees'] as List<dynamic>?)
						?.map((e) => Referee.(e as Map<String, dynamic>))
						.toList(),
		);
	}



	Map<String, dynamic> () {
		return {
			'area': area?.(),
			'competition': competition?.(),
			'season': season?.(),
			'id': id,
			'utcDate': utcDate,
			'status': status,
			'matchday': matchday,
			'stage': stage,
			'group': group,
			'lastUpdated': lastUpdated,
			'homeTeam': homeTeam?.(),
			'awayTeam': awayTeam?.(),
			'score': score?.(),
			'odds': odds?.(),
			'referees': referees?.map((e) => e.()).toList(),		};
	}

	@override
	List<Object?> get props {
		return [
				area,
				competition,
				season,
				id,
				utcDate,
				status,
				matchday,
				stage,
				group,
				lastUpdated,
				homeTeam,
				awayTeam,
				score,
				odds,
				referees,
		];
	}
}
